import React from 'react'
import Studentnavbar from './Studentnavbar'
import '../styles/Forms.css';

const StudentLogin = () => {
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");
  const[confirmpass,setConformpass]=useState("");
  let handleLogin=()=>{
    alert(email);
    alert(password);
  }
  return (
    <>
    <Studentnavbar/>
    <div className='form-wrapper'>
    <h3 style={{color:"#28a745", textAlign:"center",fontSize:"2.5vw",padding:'0px',margin:'0px',fontWeight:"500"}}>Login form</h3>
         <p className='form-label'>Email</p>
         <input className='form-input' type='text' value={email} onChange={(event=>setEmail(event.target.value))}/>
         <p className='form-label'>Password</p>
         <input className='form-input' type='password' value={password} onChange={(event=>setPassword(event.target.value))}/>
         <p className='form-label'>Confirm Password</p>
         <input className='form-input' type='password' value={confirmpass} onChange={(event=>setConformpass(event.target.value))}/>
         <button className='form-button' onClick={handleLogin}>Login</button>
    </div>
    </>
  )
}

export default StudentLogin
